	public function __construct($id = false, $table = null, $ds = null) {
		$this->_setupValidation();
		parent::__construct($id, $table, $ds);
	}

	protected function _setupValidation() {
		$this->validatePasswordChange = array(
			'new_password' => $this->validate['password'],
			'confirm_password' => array(
				'required' => array('rule' => array('compareFields', 'new_password', 'confirm_password'), 'required' => true, 'message' => 'Mật khẩu không trùng khớp.')),
			'old_password' => array(
				'to_short' => array('rule' => 'validateOldPassword', 'required' => true, 'message' => 'Mật khẩu cũ không đúng')));
	}

	/**
	 * Validation method to compare two fields
	 *
	 * @param mixed $field1 Array or string, if array the first key is used as fieldname
	 * @param string $field2 Second fieldname
	 * @return boolean True on success
	 */
	public function compareFields($field1, $field2) {
		if (is_array($field1)) {
			$field1 = key($field1);
		}
		if (isset($this->data[$this->alias][$field1]) && isset($this->data[$this->alias][$field2]) &&
			$this->data[$this->alias][$field1] == $this->data[$this->alias][$field2]) {
			return true;
		}
		return false;
	}

	/**
	 * Validation method to check the old password
	 *
	 * @param array $password
	 * @return boolean True on success
	 */
	public function validateOldPassword($password) {
		if (!isset($this->data[$this->alias]['id']) || empty($this->data[$this->alias]['id'])) {
			if (Configure::read('debug') > 0) {
				throw new OutOfBoundsException('$this->data[\'' . $this->alias . '\'][\'id\'] has to be set and not empty');
			}
		}

		$currentPassword = $this->field('password', array($this->alias . '.id' => $this->data[$this->alias]['id']));
		return $currentPassword === Security::hash($password['old_password'], null, true);
	}

	/**
	 * Tên đăng nhập tồn tại từ khóa xấu.
	 *
	 * @param array $password
	 * @return boolean True on success
	 */
	public function email_deny_word(){
		$array_deny = $this->get_word_deny();
		if (isset($this->data[$this->alias]['email']) && in_array($this->data[$this->alias]['email'],$array_deny)){
			return false;
		}
		return true;
	}

	public function username_deny_word(){
		$array_deny = $this->get_word_deny();
		if ( isset($this->data[$this->alias]['username'])
			&& in_array($this->data[$this->alias]['username'],$array_deny)
			&& $this->data[$this->alias]['username'] != ''
		){
			return false;
		}
		return true;
	}

