	/**
	 * Custom validation method to ensure that the two entered passwords match
	 *
	 * @param string $password Password
	 * @return boolean Success
	 */
	public function confirmTempPassword($password = null) {
		if ((isset($this->data[$this->alias]['password']) && isset($password['temppassword']))
			&& !empty($password['temppassword'])
			&& ($this->data[$this->alias]['password'] === $password['temppassword'])) {
			return true;
		}
		return false;
	}

	public function confirmPassword($password = null) {
		if ((isset($this->data[$this->alias]['temppassword']) && isset($password['password']))
			&& !empty($password['password'])
			&& ($this->data[$this->alias]['temppassword'] === $password['password'])) {

			return true;
		}
		return false;
	}

	public function phone_check(){
		$array_nine_number = array('098','097','096','091','094','090','093','092','086','088','089');
		$array_ten_number = array('0169','0168','0167','0166','0165','0164','0163','0162','0123','0124','0125'
		,'0127','0129','0120','0122','0126','0128','0121');
		if(isset($this->data[$this->alias]['phone'])){
			$phone = $this->data[$this->alias]['phone'];
			$count = strlen($phone);
			if ((in_array(substr($phone,0,3),$array_nine_number) && $count == 10) || (in_array(substr($phone,0,4),$array_ten_number) && $count == 11) ){
				return true;
			}else{
				return false;
			}
		}
		return true;
	}

	public function add($postData = null)
	{
		if (!empty($postData)) {
			$this->set($postData);
			if ($this->validates()) {
				if (!empty($postData[$this->alias]['password']))
					$postData[$this->alias]['password'] = Security::hash($postData[$this->alias]['password'], 'sha1', true);
				$this->create();
				if ($result = $this->save($postData, false)) {
					$result[$this->alias][$this->primaryKey] = $this->id;
					$this->data = $result;
					return true;
				}
			} else {
				return false;
			}
		}
		return false;
	}

	/**
	 * Returns the search data - Requires the CakeDC Search plugin to work
	 *
	 * @param string $state Find State
	 * @param string $query Query options
	 * @param string $results Result data
	 * @return array
	 * @link https://github.com/CakeDC/search
	 */
	protected function _findSearch($state, $query, $results = array()) {
		if (!App::import('Lib', 'Utils.Languages')) {
			throw new MissingPluginException(array('plugin' => 'Search'));
		}

		if ($state == 'before') {
			$this->Behaviors->attach('Containable', array('autoFields' => false));
			$results = $query;
			if (!empty($query['by'])) {
				$by = $query['by'];
			}

			if (empty($query['search'])) {
				$query['search'] = '';
			}

			$db =& ConnectionManager::getDataSource($this->useDbConfig);
			$by = $query['by'];
			$search = $query['search'];
			$byQuoted = $db->value($search);
			$like = '%' . $query['search'] . '%';

			switch ($by) {
				case 'username':
					$results['conditions'] = Set::merge(
						$query['conditions'],
						array($this->alias . '.username LIKE' => $like));
					break;
				case 'email':
					$results['conditions'] = Set::merge(
						$query['conditions'],
						array($this->alias . '.email LIKE' => $like));
					break;
				case 'any':
					$results['conditions'] = Set::merge(
						$query['conditions'],
						array('OR' => array(
							array($this->alias . '.username LIKE' => $like),
							array($this->alias . '.email LIKE' => $like))));
					break;
				case '' :
					$results['conditions'] = $query['conditions'];
					break;
				default :
					$results['conditions'] = Set::merge(
						$query['conditions'],
						array($this->alias . '.username LIKE' => $like));
					break;
			}

			if (isset($query['operation']) && $query['operation'] == 'count') {
				$results['fields'] = array('COUNT(DISTINCT ' . $this->alias . '.id)');
			} else {
				//$results['fields'] = array('DISTINCT User.*');
			}
			return $results;
		} elseif ($state == 'after') {
			if (isset($query['operation']) && $query['operation'] == 'count') {
				if (isset($query['group']) && is_array($query['group']) && !empty($query['group'])) {
					return count($results);
				}
				return $results[0][0]['COUNT(DISTINCT ' . $this->alias . '.id)'];
			}
			return $results;
		}
	}

	public function findByAccountId($data = array())
	{
		$accountId = $data['account_id'];

		$addCond = array();
		if (!empty($data['game_id'])) {
			$addCond = array('game_id' => $data['game_id']);
		}

		$ids = array();
		$accounts = $this->Account->find('all', array(
			'conditions' => array_merge(array('account_id' => $accountId), $addCond),
			'recursive' => -1
		));

		if (empty($accounts))
			return 0;

		$ids = Hash::extract($accounts, '{n}.Account.user_id');

		return implode(',', $ids);
	}

	public function findStaff($params = array())
	{
		if (!empty($params['staff'])) {
			$conditions = $this->find('list', array(
				'fields' => array('id', 'id'),
				'conditions' => array(
					'NOT' => array(
						'User.role' => array('Guest', 'User')
					)
				)
			));
			return implode(",", $conditions);
		}
	}


	/**
	 * Registers a new user
	 *
	 * Options:
	 * - bool emailVerification : Default is true, generates the token for email verification
	 * - bool removeExpiredRegistrations : Default is true, removes expired registrations to do cleanup when no cron is configured for that
	 * - bool returnData : Default is true, if false the method returns true/false the data is always available through $this->User->data
	 *
	 * @param array $postData Post data from controller
	 * @param mixed should be array now but can be boolean for emailVerification because of backward compatibility
	 * @return mixed
	 */
	public function register($postData = array(), $options = array()) {
		if (is_bool($options)) {
			$options = array('emailVerification' => $options);
		}

		$defaults = array(
			'emailVerification' => true,
			'removeExpiredRegistrations' => true,
			'returnData' => true
		);

		extract(array_merge($defaults, $options));
		$postData['User']['country_code'] = $this->getCountry();

		# default $emailVerification = true
		$postData = $this->_beforeRegistration($postData, $emailVerification);

		$this->set($postData);
		if ($this->validates()) {
			$postData[$this->alias]['password'] = Security::hash($postData[$this->alias]['password'], 'sha1', true);
			$this->create();
			$this->data = $this->save($postData, false);
			$this->data[$this->alias]['id'] = $this->id;
			if ($returnData) {
				return $this->data;
			}
			return true;
		}
		return false;
	}

	public function getCountry(){
		try{
			App::import('Lib', 'DetectIp');
			$geo_id = new DetectIp();
			$ip = $geo_id->publicClientIp();
			$this->Reader = new Reader(ROOT . DS . 'vendors' . DS . 'GeoIP2-php' . DS . 'GeoIP2-Country.mmdb');
			$record = $this->Reader->country($ip);
			$country = $record->country->names['en'];
		}catch (Exception $e){
			CakeLog::error('Detect country error : '.$e->getMessage());
			$country = 'unknown';
		}
		return $country;
	}

	/**
	 * Optional data manipulation before the registration record is saved
	 *
	 * @param array post data array
	 * @param boolean Use email generation, create token, default true
	 * @return array
	 */
	protected function _beforeRegistration($postData = array(), $useEmailVerification = true) {
		if ($useEmailVerification == true) {
			$postData[$this->alias]['email_token'] = $this->generateToken();
			$postData[$this->alias]['email_token_expires'] = date('Y-m-d H:i:s', time() + 7 * 86400);
		} else {
			$postData[$this->alias]['email_verified'] = 1;
		}
		$postData[$this->alias]['active'] = 1;
		return $postData;
	}

	/**
	 * Generate token used by the user registration system
	 *
	 * @param int $length Token Length
	 * @return string
	 */
	public function generateToken($length = 16) {
		$possible = '0123456789abcdefghijklmnopqrstuvwxyz';
		$token = "";
		$i = 0;

		while ($i < $length) {
			$char = substr($possible, mt_rand(0, strlen($possible) - 1), 1);
			if (!stristr($token, $char)) {
				$token .= $char;
				$i++;
			}
		}
		return md5(uniqid() . $token);
	}

	/**
	 * Use to create new account in order to connect to game
	 **/
	public function createAccount($game, $userId = null, $fbId = null,$email_google_play = null,$id_game_center = null)
	{
		try {
			if (empty($this->id)) {
				if (empty($userId)) {
					throw new InternalErrorException('Không có giá trị Id');
				} else {
					$this->id = $userId;
				}
			}

			$count = $this->Account->find('count', array(
				'conditions' => array(
					'user_id' => $this->id,
					'game_id' => $game['id']
				)
			));

			if (!empty($count)) {
				CakeLog::info('Tài khoản đã tồn tại ' . $this->id . ' - ' . $game['id']);
				throw new InternalErrorException('Tài khoản đã tồn tại' . $this->id . ' - ' . $game['id']);
			}

			# check if this game can play on multi OS
			if (!empty($game['alias'])) {
				$Game = ClassRegistry::init('Game');

				$similarGames = $Game->find('all', array(
					'recursive' => -1,
					'conditions' => array(
						'alias' => $game['alias']
					)
				));

				# find first OS that the user played
				if (!empty($similarGames)) {
					$ids = Hash::extract($similarGames, "{n}.Game.id");
					$this->Account->contain();
					$accountExisted = $this->Account->find('first', array(
						'conditions' => array(
							'user_id' => $userId,
							'game_id' => $ids
						),
						'order' => array('id' => 'ASC')
					));
				}
			}

			# if the user played on other OS then we will use account ID on this game;
			if (!empty($accountExisted)) {
				if (empty($accountExisted['Account']['account_id'])) {
					$accountId = $accountExisted['Account']['id'];
				} else {
					$accountId = $accountExisted['Account']['account_id'];
				}
				# else check last account ID and generate a new ID = old ID + 1, append a random number
			} else {
				$this->Account->contain();
				$lastAccount = $this->Account->find('first', array('order' => array('id' => 'DESC')));
				$accountId = (int)(($lastAccount['Account']['id'] + 1) . rand(1, 9)); # append rand number avoid duplicate character if admin want to test delete account
			}
			
			if ($this->Account->save(array(
				'Account' => array(
					'game_id' => $game['id'],
					'user_id' => $this->id,
					'account_id' => $accountId,
					'email_google_play' => $email_google_play,
					'id_game_center' => $id_game_center,
					'fb_id' => $fbId
				)
			))
			) {
				return true;
			}
			return false;
		}catch (Exception $e){
			debug($e->getMessage());
		}
	}
